import {renderToString,renderToNodeStream} from 'react-dom/server'
import React from 'react'
import App from '../src/app'
import {StaticRouter} from 'react-router-dom'

import staticPath from '../dist/asset-manifest.json'
import axios from 'axios'
import store from '../src/store/state'
// console.log(staticPath)
// function App(){
// 	return <h2>server side App</h2>
// }



const app = express()
// work with express
const server = require('http').Server(app)



// const userRouter = require('./user')
var path = require('path');
// app.use(cookieParser())
// app.use(bodyParser.json())
// app.use('/user',userRouter)
app.use(function(req,res,next){
	// for(let key in req)
	// console.log(req.domain)
	// console.log(req.baseUrl)
	// console.log(req.originalUrl)
	// console.log(Object.keys(req))
	// if(req.url.startsWith('/api/') || req.url.startsWith('/static/')){
	// 		return next()
	// }
	// return res.sendFile(path.resolve('build/index.html'));
	// console.log(require(''))
	const context = {}


		// axios.get(req.headers.host+'/user/info')
		// 	.then(res=>{
		// 		console.log(res)
		// 		if (res.status==200 && res.data.code==0) {

		// 				store.dispatch(loadData(res.data.data))
		// 				console.log(store.getState())

		// 		}
		// 	})
	// console.log('xx2')
	// const markupStream = renderToNodeStream(
	// 	(<Provider store={store}>
	// 		<StaticRouter
	// 			location={req.url}
	// 	    context={context}
	//    >
	// 			<App></App>
	// 		</StaticRouter>
	// 	</Provider>)
	// )
	const markup = renderToString(
		(<Provider store={store}>
			<StaticRouter
				location={req.url}
		    context={context}
	   >
				<App></App>
			</StaticRouter>
		</Provider>)
	)
// 	res.write(`<!doctype html>
// <html lang="en">
//   <head>
//     <meta charset="utf-8">
//     <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
//     <meta name="theme-color" content="#000000">
//     <link rel="stylesheet" href="/${staticPath['main.css']}">
//     <meta name="description" content="React开发招聘 App" />
//     <meta name="keywords" content="React,Redux,SSR,React-router,Socket.io" />
//     <meta name="author" content="Imooc" >
//     <title>Redux+React Router+Node.js全栈开发聊天App</title>

//   </head>
//   <body>
//     <noscript>
//       You need to enable JavaScript to run this app.
//     </noscript>
//     <div id="root">`)
	// console.log('xx1')
	// markupStream.pipe(res, { end: false });
 //  markupStream.on('end', () => {
	// 	console.log('xx')
 //    res.write(`
	// 		</div>
	// 		    <script src="/${staticPath['main.js']}"></script>
	// 		  </body>
	// 		</html>
 //    `);
 //    res.end();
 //  });

	const page = `<!doctype html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
    <meta name="theme-color" content="#000000">
    <link rel="stylesheet" href="/${staticPath['base.css']}">
    <link rel="stylesheet" href="/${staticPath['index.css']}">
    <meta name="description" content="React开发招聘 App" />
    <meta name="keywords" content="React,Redux,SSR,React-router,Socket.io" />
    <meta name="author" content="Imooc" >
    <title>Redux+React Router+Node.js全栈开发聊天App</title>

  </head>
  <body>
    <noscript>
      You need to enable JavaScript to run this app.
    </noscript>
    <div id="root">${markup}</div>
    <script src="/${staticPath['runtime.js']}"></script>
    <script src="/${staticPath['base.js']}"></script>
    <script src="/${staticPath['index.js']}"></script>
  </body>
</html>

	`
	return res.send(page)
})
// app.use(express.static('build'))
app.use('/', express.static(path.resolve('dist')))
server.listen(9093,function(){
	console.log('Node app start at port 9093')
})

